import React from "react";
import googleMapsImage from "../../img/googlemaps.png"
import "./Main.css";  


function GoogleMapsAPI() { 
  return (
    <React.Fragment>
      <img src={googleMapsImage} alt="Google Maps example" />
    </React.Fragment>
  )
}

export default GoogleMapsAPI;
